import memory_profiler
import time


def decor(func):
    def wrapper(*args, **kwargs):
        start_val = time.time()
        m1 = memory_profiler.memory_usage()
        res = func(args[0])
        m2 = memory_profiler.memory_usage()
        end_val = time.time()
        mem_diff = m2[0] - m1[0]
        res_time = end_val - start_val
        return res, f'Память {mem_diff}', f'Время {res_time}'
    return wrapper


my_list = []


@decor
def lst_app(my_lst):
    for i in range(500000):
        my_lst.append(i)
    return my_lst

res, mem, timee = lst_app(my_list)
print(mem, timee)
