# Генератор очень сильно снижает использование памяти и влияет на время выполнения положительно



from memory_profiler import profile


@profile
def revers_4(enter_num):
    a = []
    for i in str(enter_num):
        a.append(i)
    a.reverse()
    my_str = ''
    for i in a:
        my_str += i
    return my_str


# Пришлось сделать такое больше число, чтобы заметить изменения в памяти
print(revers_4())


