@profile
def revers_4_1(enter_num):
    a = [i for i in str(enter_num)]  # создание списка с помощью lc снижает использование памяти
    my_str = ''.join(a[::-1])  # Здесь мы не храним список до конца программы, так как переворачиваем его во время генерации нужной нам строки
    return my_str
# Таким образом используем в 2 раза меньше памяти

