import memory_profiler
from numpy import array
import numpy

def decor(func):
    def wrapper(*args, **kwargs):
        m1 = memory_profiler.memory_usage()
        res = func(args[0])
        m2 = memory_profiler.memory_usage()
        mem_diff = m2[0] - m1[0]
        return res, mem_diff
    return wrapper


@memory_profiler.profile
def func_1(nums):
    new_arr = []
    for i in range(len(nums)):
        if nums[i] % 2 == 0:
            new_arr.append(i)
    return new_arr


func_1(list(range(100000)))

# Используя array из библиотеки numpy использование памяти снижается аж в 7 раз
@memory_profiler.profile
def func_2(nums):
    new_arr = numpy.array([])
    for i in range(len(array(nums))):
        if array(nums)[i] % 2 == 0:
            numpy.append(new_arr, i)
    return array(new_arr)


func_2(array(range(100000)))

